import{_ as e,c as a,o as i,f as n}from"./chunks/framework.wcBTHMk5.js";const g=JSON.parse('{"title":"Denis Starov CV","description":"My skillset and potential","frontmatter":{"title":"Denis Starov CV","description":"My skillset and potential","date":"2024-01-29T00:00:00.000Z"},"headers":[],"relativePath":"cv/index.md","filePath":"cv/index.md"}'),r={name:"cv/index.md"},t=n('<p>Broad range designer and web developer based in Phuket, Thailand.</p><p><a href="https://github.com/davay42" target="_blank" rel="noreferrer">GitHub Profile</a> | <a href="http://starovdenis.com" target="_blank" rel="noreferrer">Personal Website</a> | <a href="https://www.linkedin.com/in/denis-starov/" target="_blank" rel="noreferrer">LinkedIn profile</a></p><hr><h2 id="profile" tabindex="-1">Profile <a class="header-anchor" href="#profile" aria-label="Permalink to &quot;Profile&quot;">​</a></h2><p>I am a freelance digital designer and frontend developer with very wide skillset. I have more than 10 years of experience in web technologies. I build UIs with Vue and many other amazing open source libraries. Like Paper.js providing clever SVG animations and WebGL shaders for effects and fast renders. Or like VueUse reactive browser APIs and BLE device control and monitoring. Or the TailwindCSS and WebAudio + WebMIDI APIs. From installable PWAs to on-device audio analysis.</p><p>I am passionate about working on impactful projects. I&#39;m open for participation in creative industry and art projects, involving experiments with audio synthesis, vector graphics, web animations, interfaces and intermedia.</p><hr><h2 id="skillset" tabindex="-1">Skillset <a class="header-anchor" href="#skillset" aria-label="Permalink to &quot;Skillset&quot;">​</a></h2><h3 id="frontend-development" tabindex="-1">Frontend Development <a class="header-anchor" href="#frontend-development" aria-label="Permalink to &quot;Frontend Development&quot;">​</a></h3><ul><li>Vue 3</li><li>Vitepress</li><li>VueUse</li><li>UnoCSS (Tailwind)</li><li>Tone.js</li></ul><h3 id="backend-development" tabindex="-1">Backend Development <a class="header-anchor" href="#backend-development" aria-label="Permalink to &quot;Backend Development&quot;">​</a></h3><ul><li>Node</li><li>Nuxt</li><li>Directus <ul><li>PostgreSQL</li><li>REST API</li><li>Web-sockets</li></ul></li></ul><hr><h2 id="work-experience" tabindex="-1">Work experience <a class="header-anchor" href="#work-experience" aria-label="Permalink to &quot;Work experience&quot;">​</a></h2><p><strong>Interactive experience designer</strong> @ Playtronica | Freelance | 2022-2024</p><ul><li>Easy terms and nice remote work experience</li><li>MIDI enabled Tone.js music synthesizer and custom SVG visualization for TouchMe Experience</li><li>A Tone.js synthesizer and visualizer of musical notes played on a MIDI controller or a computer keyboard</li><li>Interactive user experience with multiple scenes and usage statistics</li><li>SVG animations, full-screen mode and other modern web tech</li><li>Lightweight UI and reactive database for the Web Synth Collection</li></ul><p><strong>Music Theory Teacher</strong> @ SkillBox | Visual Music Course | 2022-2023</p><ul><li>Online course presenter experience with a complete video production team</li><li>Deep research verified and mapped with a professional methodologist</li><li>Work with remote students and educational materials production</li></ul><p><strong>Product graphic designer</strong> @ SkillPad | Freelance | 2018-2021</p><ul><li>Adobe Illustrator vector design for print and packaging</li><li>Print shop communication and comprehensive print material research</li><li>Customer relations and product quality control</li></ul><hr><h2 id="personal-projects" tabindex="-1">Personal projects <a class="header-anchor" href="#personal-projects" aria-label="Permalink to &quot;Personal projects&quot;">​</a></h2><p><strong>Research and development</strong> @ chromatone.center | 2014 - Present</p><ul><li>Visual Music Theory research from the very basics to profound composition knowledge</li><li>Knowledge packed in Theory articles and learning experience packed in Practice web-apps for everyone</li><li>Real life tested and refined Vue + Vitepress web-app build process</li><li>Working print shop and custom LMS in development</li></ul><p><strong>Musician, composer and live music performer</strong> @ tsoop.com | 2017 - Present</p><ul><li>Live multimedia generation - I create both music and visuals right at the moment</li><li>Full yet portable electronic music performance and recording setup</li><li>5 albums, 2 singles published on all major platforms</li></ul><p><strong>Research, design, video production, crafts and copywriter</strong> @ OOLEY | 2012-2022</p><ul><li>Makerspace catalog and up-to-date map</li><li>Interviews and video reviews recording, editing and publishing</li><li>Educational events planning and conducting</li><li>Full brand design and media package</li></ul><hr><h2 id="npm-packages-maintainer" tabindex="-1">NPM Packages Maintainer <a class="header-anchor" href="#npm-packages-maintainer" aria-label="Permalink to &quot;NPM Packages Maintainer&quot;">​</a></h2><ul><li>@gun-vue - Toolset for easy p2p app development with Gun database and Vue 3 reactive components system</li><li>gun-avatar - Simple JS avatar generator for use with SEA Cryptographic keypairs</li><li>use-chromatone - Interactive visual music toolkit</li></ul><hr><h2 id="education" tabindex="-1">Education <a class="header-anchor" href="#education" aria-label="Permalink to &quot;Education&quot;">​</a></h2><h3 id="bachelor-of-engineering-be" tabindex="-1">Bachelor of Engineering - BE <a class="header-anchor" href="#bachelor-of-engineering-be" aria-label="Permalink to &quot;Bachelor of Engineering - BE&quot;">​</a></h3><p>Mendeleev University of Chemical Technology of Russia 2004–2008</p><ul><li>Chemical Engineering</li><li>Technical English Translation</li><li>Glass Ceramics Technology</li></ul><h3 id="english-language-upper-intermediate-b2" tabindex="-1">English language - Upper intermediate - B2 <a class="header-anchor" href="#english-language-upper-intermediate-b2" aria-label="Permalink to &quot;English language - Upper intermediate - B2&quot;">​</a></h3><h3 id="thai-language-elementary" tabindex="-1">Thai language - Elementary <a class="header-anchor" href="#thai-language-elementary" aria-label="Permalink to &quot;Thai language - Elementary&quot;">​</a></h3><h2 id="open-for-new-projects" tabindex="-1">Open for new projects <a class="header-anchor" href="#open-for-new-projects" aria-label="Permalink to &quot;Open for new projects&quot;">​</a></h2><p>I create purposeful web-sites and internal tools for any business and personal use. It may be anything from the list:</p><ul><li>Portfolio or Catalog static site built with Vitepress,</li><li>Blog with Comments and Reactions, served by Nuxt,</li><li>Internal CRM with analytics based on Directus,</li><li>Online Shop with payments API from Stripe or other providers,</li><li>Resource Management system with e-mail or other notifications system,</li><li>Internal Knowledge Base with certain fields available as public APIs and a client web-app,</li><li>a discussion and rating platform,</li></ul><p>or any custom business-logic and interfaces for it. Let&#39;s talk!</p><hr><h2 id="contact-me" tabindex="-1">Contact me <a class="header-anchor" href="#contact-me" aria-label="Permalink to &quot;Contact me&quot;">​</a></h2><p>Email: <a href="mailto:me@starovdenis.com" target="_blank" rel="noreferrer">me@starovdenis.com</a> GitHub: <a href="https://github.com/davay42" target="_blank" rel="noreferrer">davay42</a> LinkedIn: <a href="https://www.linkedin.com/in/denis-starov/" target="_blank" rel="noreferrer">Denis Starov</a></p>',45),l=[t];function o(s,c,d,p,h,u){return i(),a("div",null,l)}const f=e(r,[["render",o]]);export{g as __pageData,f as default};
